  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:25.339769\",\n\t\"name\": \"ninigret-national-wildlife-refuge-2012-fall-banding-summary\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes bird banding results
  at Ninigret National Wildlife Refuge during the fall of 2012.  The Ninigret banding
  station opened nets on 4 September and closed them on 26 October for a total of
  25 days.  We operated a total of 18 nets divided into two loops consisting of ten
  nets in the southern and northern half of the study area.  We opened ten nets at
  a time and alternated loops daily.  Daily net hours and the number of open nets
  varied depending on weather conditions, but typically nets were opened 20 minutes
  before sunrise and closed around 11:00 for four days per week.  We ran the nets
  for a total of 1010.5 net hours (one net open for 1 hour equals 1 net hour, rounded
  to the nearest quarter hour).  Report includes total birds captured, capture rates,
  and species totals.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
